import { useOrganization, useOrganizationList, useUser } from '@clerk/clerk-react';
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AddBill.css';

const AddBill = () => {
  const navigate = useNavigate();
  const { user } = useUser();
  const { organizationList, isLoaded: isOrgListLoaded } = useOrganizationList();
  const { organization, isLoaded: isOrgLoaded } = useOrganization();

  const [description, setDescription] = useState('');
  const [amount, setAmount] = useState('');
  const [selectedOrg, setSelectedOrg] = useState('');
  const [selectedMember, setSelectedMember] = useState('');
  const [members, setMembers] = useState([]);
  const [date, setDate] = useState(new Date().toISOString().split('T')[0]);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');

  // Update members list when organization changes
  useEffect(() => {
    const fetchMembers = async () => {
      if (selectedOrg && organizationList) {
        try {
          setIsLoading(true);
          const org = organizationList.find(org => org.id === selectedOrg);
          if (org) {
            const membersList = await org.getMemberships();
            setMembers(membersList.data || []);
            setSelectedMember(''); // Reset selected member when org changes
          }
        } catch (err) {
          console.error('Error fetching members:', err);
          setError('Failed to load group members');
        } finally {
          setIsLoading(false);
        }
      }
    };

    fetchMembers();
  }, [selectedOrg, organizationList]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    // Handle bill submission logic here
    console.log({
      description,
      amount,
      selectedOrg,
      selectedMember,
      date
    });
  };

  if (!isOrgListLoaded || !isOrgLoaded) {
    return (
      <div className="loading-container">
        <div className="loading-spinner">Loading groups...</div>
      </div>
    );
  }

  return (
    <div className="add-bill-container">
      <h1>Add a bill</h1>
      <p className="subtitle">Add a new bill to track expenses</p>

      {error && <div className="error-message">{error}</div>}

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="organization">Select Group</label>
          <select
            id="organization"
            value={selectedOrg}
            onChange={(e) => setSelectedOrg(e.target.value)}
            required
            className="select-input"
          >
            <option value="">Select a group</option>
            {organizationList && organizationList.map((org) => (
              <option key={org.id} value={org.id}>
                {org.name}
              </option>
            ))}
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="description">Description</label>
          <input
            id="description"
            type="text"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            placeholder="Enter bill description"
            required
            className="text-input"
          />
        </div>

        <div className="form-group">
          <label htmlFor="amount">Amount</label>
          <div className="amount-input-container">
            <span className="currency-symbol">$</span>
            <input
              id="amount"
              type="number"
              value={amount}
              onChange={(e) => setAmount(e.target.value)}
              placeholder="0.00"
              required
              min="0"
              step="0.01"
              className="amount-input"
            />
          </div>
        </div>

        <div className="form-group">
          <label htmlFor="paidBy">Who paid?</label>
          <select
            id="paidBy"
            value={selectedMember}
            onChange={(e) => setSelectedMember(e.target.value)}
            required
            className="select-input"
            disabled={!selectedOrg || isLoading}
          >
            <option value="">
              {isLoading ? 'Loading members...' : 'Select who paid'}
            </option>
            {members.map((member) => (
              <option 
                key={member.id} 
                value={member.publicUserData?.userId}
              >
                {member.publicUserData?.identifier === user.primaryEmailAddress.emailAddress 
                  ? 'You'
                  : member.publicUserData?.identifier}
              </option>
            ))}
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="date">Date</label>
          <input
            id="date"
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            required
            className="date-input"
          />
        </div>

        <button 
          type="submit" 
          className="submit-btn"
          disabled={isLoading}
        >
          {isLoading ? 'Loading...' : 'Add Bill'}
        </button>
      </form>
    </div>
  );
};

export default AddBill;
